import React from "react";
import { Match_card_component } from "../match-card-component/match-card-component";

export const Match_Card_List_Component = (props) => {
  console.log(props);
  return (
    <div>
      <div>
        {props.matches.map((matches) => (
          <Match_card_component
            key={matches.id}
            matches={matches}
          ></Match_card_component>
        ))}
      </div>
    </div>
  );
}; // end Component
